import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { ThemeProvider, CssBaseline } from '@mui/material';
import { useAuth } from './context/AuthContext';
import { Box, CircularProgress } from '@mui/material';
import luxuryTheme from './theme/luxuryTheme';

// Import pages
import Login from './pages/Login';
import Dashboard from './pages/Dashboard';
import LandList from './pages/LandList';
import LandDetails from './pages/LandDetails';
import RegisterLand from './pages/RegisterLand';
import MapView from './pages/MapView';
import Profile from './pages/Profile';
import Transfers from './pages/Transfers';
import AdminDashboard from './pages/AdminDashboard';
import AdminUsers from './pages/AdminUsers';
import AdminLands from './pages/AdminLands';
import AdminTransfers from './pages/AdminTransfers';
import AdminReports from './pages/AdminReports';

// Import components
import Navbar from './components/Navbar';
import ProtectedRoute from './components/ProtectedRoute';
import AdminRoute from './components/AdminRoute';

function App() {
  const { loading, isAuthenticated } = useAuth();

  if (loading) {
    return (
      <ThemeProvider theme={luxuryTheme}>
        <CssBaseline />
        <Box
          display="flex"
          justifyContent="center"
          alignItems="center"
          minHeight="100vh"
          sx={{
            background: 'linear-gradient(135deg, #0C0C0C 0%, #1A1A1A 50%, #000000 100%)',
          }}
        >
          <Box sx={{ textAlign: 'center' }}>
            <Box
              sx={{
                width: 80,
                height: 80,
                borderRadius: '50%',
                border: '4px solid rgba(255, 215, 0, 0.3)',
                borderTop: '4px solid #FFD700',
                animation: 'rotate 1s linear infinite',
                mb: 2,
                '@keyframes rotate': {
                  '0%': { transform: 'rotate(0deg)' },
                  '100%': { transform: 'rotate(360deg)' },
                },
              }}
            />
            <Box sx={{ color: '#FFD700', fontSize: '1.2rem', fontWeight: 600 }}>
              Loading Luxury Experience...
            </Box>
          </Box>
        </Box>
      </ThemeProvider>
    );
  }

  return (
    <ThemeProvider theme={luxuryTheme}>
      <CssBaseline />
      <div className="App">
        {isAuthenticated() && <Navbar />}

        <Routes>
          {/* Public routes */}
          <Route 
            path="/login" 
            element={
              isAuthenticated() ? <Navigate to="/dashboard" replace /> : <Login />
            } 
          />

          {/* Protected routes */}
          <Route path="/" element={<ProtectedRoute />}>
            <Route index element={<Navigate to="/dashboard" replace />} />
            <Route path="dashboard" element={<Dashboard />} />
            <Route path="lands" element={<LandList />} />
            <Route path="lands/:id" element={<LandDetails />} />
            <Route path="register-land" element={<RegisterLand />} />
            <Route path="transfers" element={<Transfers />} />
            <Route path="map" element={<MapView />} />
            <Route path="profile" element={<Profile />} />
          </Route>

          {/* Admin routes */}
          <Route path="/admin" element={<AdminRoute />}>
            <Route index element={<Navigate to="/admin/dashboard" replace />} />
            <Route path="dashboard" element={<AdminDashboard />} />
            <Route path="users" element={<AdminUsers />} />
            <Route path="lands" element={<AdminLands />} />
            <Route path="transfers" element={<AdminTransfers />} />
            <Route path="reports" element={<AdminReports />} />
          </Route>

          {/* Catch all route */}
          <Route 
            path="*" 
            element={
              <Navigate to={isAuthenticated() ? "/dashboard" : "/login"} replace />
            } 
          />
        </Routes>
      </div>
    </ThemeProvider>
  );
}

export default App;
